function whatIsInAName(collection, source) {
  // What's in a name?
  var arr = [];
  // Only change code below this line
  let sourceKeys = Object.keys(source);
  for (let collect in collection){
    let count = 0;
    for (let i = 0; i < sourceKeys.length; i++){
      if (collection[collect].hasOwnProperty(sourceKeys[i])) {
        if (collection[collect][sourceKeys[i]] == source[sourceKeys[i]])
         count++; 
      }
    }
    if (count == sourceKeys.length) {
      arr.push(collection[collect]);
    }
  }

  // Only change code above this line
  return arr;
}

